import React, { Component } from 'react';
import Main from './routes/main';
import './App.css';
import NavBar from './layout/NavBar';

class App extends Component  {
    render() {
        return (  
            <div>
                <NavBar/>
                <div className="background-app" style={{ width: '100%', height: "100%"}}>
                    <Main />
                </div>
            </div>
        );
    }
}    

export default App;
